import '../App.css';
import React from "react";

function Home(){
    return(
        <div className="content">
            <h2 className="heading">Willkommen bei den Unicorns!</h2>
            <p>Du willst programmieren lernen? Hast Lust, dein eigenes Spiel zu entwickeln? 
            Oder willst einfach mal gucken, was Informatik überhaupt ist und ob du dich dafür interessierst?</p>

            <p>Wir bieten Programmierkurse für MINTA* (Mädchen, Inter, Non-Binär, Trans- und Agender) von 13-16 Jahren an, 
            für die du kein Vorwissen brauchst! Gemeinsam schauen wir uns zunächst Grundlagen an, sodass du 
            selbstsicher mit einem Computer umgehen kannst!</p> 
            
            <p>Unsere Projekte  finden in Kooperation mit der Bürgerschule Stadtteilzentrum Nordstadt und dem Chaos Computer Club Hannover statt.
            Der im Sommer 2023 startende wöchentliche Kurs wird von der Bürgerstiftung Hannover gefördert.</p>

